import{_ as s,o as a,c as e,Q as l}from"./chunks/framework.681fc4ae.js";const E=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[],"relativePath":"5team/代码托管平台/GitHub/GitHub提交常见错误.md","filePath":"5team/代码托管平台/GitHub/GitHub提交常见错误.md"}'),o={name:"5team/代码托管平台/GitHub/GitHub提交常见错误.md"},t=l('<h2 id="保存ssh-key时提示-key-is-already-in-use" tabindex="-1">保存ssh key时提示 <code>Key is already in use</code> <a class="header-anchor" href="#保存ssh-key时提示-key-is-already-in-use" aria-label="Permalink to &quot;保存ssh key时提示 `Key is already in use`&quot;">​</a></h2><p>当你通过终端获得本地的ssh key，并在GitHub上的ssh配置里，输入了正确格式的key，按下保存时，提示 <code>Key is already in use</code> ，代表你此时保存的ssh key已经在其他的GitHub账号上保存过了。同一个key是不能给多个GitHub使用的。</p><h3 id="解决方案" tabindex="-1">解决方案： <a class="header-anchor" href="#解决方案" aria-label="Permalink to &quot;解决方案：&quot;">​</a></h3><ul><li>方案1：删除另一个Github账号上保存的ssh key</li></ul><ol><li>在终端输入以下代码得到本地ssh绑定的GitHub账户。</li></ol><div class="language-sh vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">sh</span><pre class="shiki github-dark vp-code-dark"><code><span class="line"><span style="color:#B392F0;">ssh</span><span style="color:#E1E4E8;"> </span><span style="color:#79B8FF;">-T</span><span style="color:#E1E4E8;"> </span><span style="color:#79B8FF;">-i</span><span style="color:#E1E4E8;"> </span><span style="color:#9ECBFF;">~/.ssh/id_rsa</span><span style="color:#E1E4E8;"> </span><span style="color:#9ECBFF;">git@github.com</span></span></code></pre><pre class="shiki github-light vp-code-light"><code><span class="line"><span style="color:#6F42C1;">ssh</span><span style="color:#24292E;"> </span><span style="color:#005CC5;">-T</span><span style="color:#24292E;"> </span><span style="color:#005CC5;">-i</span><span style="color:#24292E;"> </span><span style="color:#032F62;">~/.ssh/id_rsa</span><span style="color:#24292E;"> </span><span style="color:#032F62;">git@github.com</span></span></code></pre></div><ol start="2"><li><p>登录这个账户。</p></li><li><p>找到setting里的ssh模块，删除绑定的这个ssh key。</p></li><li><p>重新登录之前的GitHub账号，进行保存key操作发现可行。</p></li></ol><ul><li>方案2：配置同一个key给多个GitHub使用</li></ul><p>...</p><h2 id="给电脑添加新的ssh" tabindex="-1">给电脑添加新的ssh <a class="header-anchor" href="#给电脑添加新的ssh" aria-label="Permalink to &quot;给电脑添加新的ssh&quot;">​</a></h2><p>打开终端输入：</p><div class="language-sh vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">sh</span><pre class="shiki github-dark vp-code-dark"><code><span class="line"><span style="color:#B392F0;">$</span><span style="color:#E1E4E8;"> </span><span style="color:#9ECBFF;">ssh-keygen</span><span style="color:#E1E4E8;"> </span><span style="color:#79B8FF;">-t</span><span style="color:#E1E4E8;"> </span><span style="color:#9ECBFF;">rsa</span><span style="color:#E1E4E8;"> </span><span style="color:#79B8FF;">-f</span><span style="color:#E1E4E8;"> </span><span style="color:#9ECBFF;">&quot;new_name&quot;</span></span></code></pre><pre class="shiki github-light vp-code-light"><code><span class="line"><span style="color:#6F42C1;">$</span><span style="color:#24292E;"> </span><span style="color:#032F62;">ssh-keygen</span><span style="color:#24292E;"> </span><span style="color:#005CC5;">-t</span><span style="color:#24292E;"> </span><span style="color:#032F62;">rsa</span><span style="color:#24292E;"> </span><span style="color:#005CC5;">-f</span><span style="color:#24292E;"> </span><span style="color:#032F62;">&quot;new_name&quot;</span></span></code></pre></div><h2 id="获得本地ssh-key使用时提示格式错误" tabindex="-1">获得本地ssh key使用时提示格式错误 <a class="header-anchor" href="#获得本地ssh-key使用时提示格式错误" aria-label="Permalink to &quot;获得本地ssh key使用时提示格式错误&quot;">​</a></h2><blockquote><p>保存key时提示：<code>Key is invalid. You must supply a key in OpenSSH public key format</code></p></blockquote><p>因为直接复制终端里的ssh key会导致格式错乱，黏贴到GitHub的时候会报错，所以这里建议通过命令直接复制到粘贴板：</p><div class="language-sh vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">sh</span><pre class="shiki github-dark vp-code-dark"><code><span class="line"><span style="color:#B392F0;">clip</span><span style="color:#E1E4E8;"> </span><span style="color:#F97583;">&lt;</span><span style="color:#E1E4E8;"> </span><span style="color:#9ECBFF;">~/.ssh/id_rsa.pub</span></span></code></pre><pre class="shiki github-light vp-code-light"><code><span class="line"><span style="color:#6F42C1;">clip</span><span style="color:#24292E;"> </span><span style="color:#D73A49;">&lt;</span><span style="color:#24292E;"> </span><span style="color:#032F62;">~/.ssh/id_rsa.pub</span></span></code></pre></div><h2 id="提交代码时报错" tabindex="-1">提交代码时报错 <a class="header-anchor" href="#提交代码时报错" aria-label="Permalink to &quot;提交代码时报错&quot;">​</a></h2><ul><li><p>报错：<code>ERROR: Permission to liang14658fox/liang14658fox.github.io.git denied to liang14658foxgithub. fatal: Could not read from remote repository. Please make sure you have the correct access rights and the repository exists.</code></p></li><li><p>可能的原因：</p></li></ul><ol><li>本地ssh和GitHub所绑定的不同</li></ol>',19),n=[t];function p(i,c,r,h,y,d){return a(),e("div",null,n)}const b=s(o,[["render",p]]);export{E as __pageData,b as default};
